import React, { Component } from 'react';
import Navigationbar from '../navigation';
// import userProfile from './profile';
import '@fortawesome/fontawesome-free/css/all.min.css';
import illusionsImage from '../images/illusions.jpg';
import saladImage from '../images/salad.jpg';
import maincourseImage from '../images/mainCourse.jpg';
import dessertImage from '../images/desserts.jpg';
import beveragesImage from '../images/beverages.jpg';
import PropTypes from 'prop-types';
import profilepic from './../images/download.png'
import { Redirect } from 'react-router';
import { Link } from 'react-router-dom';
import { Form, Button, Card, CardGroup} from 'react-bootstrap';
import axios from 'axios';

class viewEvents extends Component {
    constructor(props) {
        super(props);
        this.state ={};
    }

    render() {
        return (
            <React.Fragment>
            <Navigationbar />
            <div class='container'>
            <Card>
                <Card.Img variant="top" src={illusionsImage} />
                <Card.Body>
                <Card.Title>Illusions - An Outdoor Exhibition</Card.Title>
                <Card.Text> <i class="fas fa-hourglass-half"></i> <b>From</b>: Wednesday, Sep 2, 10:00 am <b>To</b>: Wednesday, Sep 30, 5:30 pm</Card.Text>
                <Card.Text>
                    Appetiser or starter is a small dish served before a meal in European cuisine
                </Card.Text>
                </Card.Body>
                <Card.Footer>
                    <a href ="/dishList/#appetizer">Full menu</a>
                </Card.Footer>
            </Card>

            </div>
            </React.Fragment>
        )}
}

export default viewEvents;
